resourceInfo.abstract:
Existing stream temperature data were compiled from numerous federal, state, tribal, and private sources to develop an integrated regional database. Spatial statistical models for river networks were applied to these data to develop an accurate model that predicts stream temperature for all fish-bearing streams in the US portion of the GNLCC. Differences between model outputs for historic and future climate scenarios were used to assess spatial variation in the vulnerability of sensitive fish species across the GNLCC.

FY2011
Objectives:

1. Develop a regional stream temperature model that incorporates important climate drivers, wildfire/riparian conditions, and geomorphic factors; 
2. Use the model to understand and predict both historic and future trends in stream temperatures for all reaches within all streams;
3. Assess geographic variation in stream temperature sensitivities to climate change and predict effects on thermal habitats for threatened and endangered aquatic species.

FY2012
2012-2013 Objectives:

The primary objective of this project is an accurate assessment and description of historical and future stream temperatures and thermal habitat distributions for sensitive aquatic species so that planning efforts can be undertaken more efficiently and with greater confidence across the GNLCC. Our objective is not to make recommendations regarding specific management activities in different locales, only to provide accurate information that is fundamental to an informed discussion about prioritizing those activities. Specific tasks include:
 1.developing a comprehensive, interagency stream temperature database;
 2.developing a regional stream temperature model that incorporates important climate drivers, riparian conditions, and geomorphic factors;
 3.using the model to predict historic and future patterns in stream temperatures for all fish-bearing streams; and
 4.translating stream temperatures to thermal habitats for assessing potential species distribution shifts across the GNLCC
